import React, { Component } from "react";
import { Link} from "react-router-dom";
import "./maze.css"

export default class Home extends Component {  
  constructor(props) {
    super(props);
    this.state = {
        num:1
    };
  }

  render() {    
    return (
        <div>
        <div className="select-title">
            미궁의 {this.state.num} 번째 클리어를 축하드립니다!
        </div>
        <div className="story">
          <div className="marginbottom">결말</div>
        </div>
        <div>
          <Link to="/Prob1"> <button className="btn">이동</button></Link>
        </div>   
      </div>
    );
  }
}
